import React, {Component} from "react";

import './style.css'

class App extends Component{

  render(){
    return(

      <div className="container">

        <div className="menuHeader">
          <button className="btnMenuAtivo">Bem-vindo</button>
          <button className="btnMenu">Trajetória Profissional</button>
          <button className="btnMenu">Trajetória Pessoal</button>
        </div>
        <div className="linhaMenu"></div>

        <div className="caixaTitulo">
          <h1 className="titulo1">Olá, Me chamo Douglas Madalena</h1>
          <h2 className="titulo2">e é um prazer te encontrar</h2>
          <h2 className="titulo3">em meu portfolio WEB</h2>
        </div>

      </div>
    )
  }
}

export default App;
